iskan waktu dengan anak sendiri?

Yuks Moms and Dads kita coba telaah lagi, kira-kira adakah yang¬† ternyata harus kita perbaiki lagi agar hubungan kita dengan anak tetap harmonis dan seluruh anggota keluarga kita lebih merasa bahagia.

1. Pagi hari
Luangkan waktu sedikit untuk bermain atau mendengar cerita anak. 

2. Siang hari
Luangkan waktu sedikit untuk menelpon anak saat jam istirahat menanyakan keadaannya. 

3. Malam hari
Sediakan waktu untuk mendengar kegiatan anak seharian dan ajak berdiskusi tentang kegiatan tersebut. 

4. Hari libur
Lakukan aktivitas menyenangkan bersama anak saat libur kantor agar ikatan semakin kuat. 

5. Di kendaraan
Saat mengantar anak sekolah, manfaatkan waktu tersebut untuk mengobrol. 

6. Saat anak sedih
Jadilah tempat curhat terbaik saat anak sedih.

7. Saat anak unjuk prestasi
Hadirlah apakah saat anak berprestasi, sedang mengikuti lomba2 atau tampil di depan orang banyak. 

Moms and Dads apa punya cara unik menikmati ‚Äúquality time‚Äù bersama anak? Yuk share disini.

